import React, { Component } from 'react';
import Navbar from './components/layout/Navbar';
import './App.css';
import UserItem from './components/users/UserItem';

class App extends Component {
  render() {

    return (
      <div className='App'>
        <Navbar title='Github finder' icon='fab fa-github' />
        <UserItem />
      </div>
    );
  }
}


export default App;
